import React from "react";
import NewsItemSearch from "./NewsItemSearch";

import { ImageSearch } from "@mui/icons-material";
import "./styles.scss";

interface INewsListParams {
  list: INews[];
}

const NewsListSearch: React.FC<INewsListParams> = ({ list }) => (
  <div className="newslist">
    {list.map((index) => (
      <NewsItemSearch key={index.show.id} item={index} />
    ))}
  </div>
);

export default NewsListSearch;
